import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="menu"></div>
        <nav className="navbar">
          <ul className="nav navbar-nav navbar">
            <li className="/#home">Home</li>

          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
